import React from "react";
import { ThemeProvider, createTheme, CssBaseline } from "@mui/material";
import Register from "./pages/Register";

const theme = createTheme();

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Register />
    </ThemeProvider>
  );
}

export default App;
